import React from 'react';
import { StyleSheet, View, Text } from 'react-native';


export const headerstyles = StyleSheet.create({
    container: {
      flex: 1,
      justifyContent: 'center',
      alignItems: 'center',
      backgroundColor: 'lightblue',
    },
    text: {
      fontSize: 24,
      fontWeight: 'bold',
      color: 'darkblue',
    },
  });
